import React from 'react';
function readData(jsonData)
{
  var ret;
  for(let data in jsonData)
  {
    switch(data)
    {
      case "Brand":
        ret+=<React.wrapper><br />Brand: {readData(jsonData[data])}</React.wrapper>;
        break;
      default:
        ret+=<React.wrapper><br />{jsonData[data]}</React.wrapper>;
    }
  }
  return ret;
}
export default readData;
